import { Header } from "./components/Header";
import Main from "./components/main";
import { Existing } from "./pages/Extisting";

function App() {
  return (
    <div className="app">
      <Login />
    </div>
  );
}
function Login() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/pages" element={<Existing />} />
        </Routes>

        <Header />
        <Router>
          <Link to={"/pages"}>Existing</Link>
        </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
